import logo from './logo.svg';
import React from 'react';
import './App.css';
import UserAccount from './UserAccount'; // UserAccountコンポーネントをインポート

function App() {
  // ユーザーデータのオブジェクトを作成
  const user = {
    name: "山田太郎",
    accountNumber: "1234567890",
    balance: 1000000,
    iconUrl: "https://example.com/user-icon.jpg"
  };

  return (
    <div className="App">
      <h1>銀行アプリ</h1>
      <UserAccount user={user} />
    </div>
  );
}

export default App;
